def camel_to_snake(camel_case):
    snake_case = re.sub(r'(?<!^)(?=[A-Z])', '_', camel_case).lower()
    return snake_case


def get_all_pir_ops(text):
    pattern = r"paddle::dialect::([A-Za-z_]+)Op"
    matches = re.findall(pattern, text)
    ans = []
    for i in matches:
        if "Grad" not in i:
            ans.append(camel_to_snake(i))
    return ans


if __name__ == '__main__':
    print(len(get_all_pir_ops(str_info)))
